(def Ts
  (let [Pyeom (map second yeom)
      Phong (map second hong)
      Lyeom (doquery :ipmcmc blind-joint-bulk [Pyeom 172])
      Lhong (doquery :ipmcmc blind-joint-bulk [Phong 141])
      Syeom (map :result (take 100 (take-nth 10 (drop 1000 Lyeom))))
      Shong (map :result (take 100 (take-nth 10 (drop 1000 Lhong))))
      Tyeom (/ (reduce + Syeom) (count Syeom))
      Thong (/ (reduce + Shong) (count Shong))]
